def dist(p1, p2):
    return math.sqrt((p1[0] - p2[0]) ** 2 + (p1[1] - p2[1]) ** 2)


def ang(p1, p2):
    return math.atan2(p2[1] - p1[1], p2[0] - p1[0])


def angdiff(a, b):
    d = (a - b + math.pi) % (2 * math.pi) - math.pi
    if d > math.pi / 2:
        d -= math.pi
    elif d < -math.pi / 2:
        d += math.pi
    return d


class Droplet:
    def __init__(self, x, y, vx, vy, r):
        self.x = x
        self.y = y
        self.vx = vx
        self.vy = vy
        self.r = r

    def __repr__(self):
        return 'Droplet({}, {}, {}, {}, {})'.format(self.x, self.y, self.vx,
                                                     self.vy, self.r)

    def __hash__(self):
        return hash((self.x, self.y, self.vx, self.vy, self.r))

    def __eq__(self, other):
        return self.x == other.x and self.y == other.y and self.vx == other.vx \
               and self.vy == other.vy and self.r == other.r

    def __lt__(self, other):
        return self.r < other.r

    def __gt__(self, other):
        return self.r > other.r

    def __le__(self, other):
        return self.r <= other.r

    def __ge__(self, other):
        return self.r >= other.r

    def move(self, dt):
        self.x += self.vx * dt
        self.y += self.vy * dt

    def getpos(self):
        return self.x, self.y

    def getvel(self):
        return self.vx, self.vy

    def getarea(self):
        return math.pi * self.r ** 2

    def getcenter(self):
        return self.x, self.y

    def getradius(self):
        return self.r

    def getangle(self):
        return ang((0, 0), (self.vx, self.vy))


def find_collisions(droplets):
    collisions = []
    i = 0
    while i < len(droplets):
        for j in range(i + 1, len(droplets)):
            if dist(droplets[i].getcenter(), droplets[j].getcenter()) <= \
                    droplets[i].getradius() + droplets[j].getradius():
                collisions.append((i, j))
        i += 1
    return collisions


def merge_droplets(droplets, i, j):
    new_droplet = Droplet(0, 0, 0, 0, 0)
    new_droplet.x = (droplets[i].getarea() * droplets[i].getcenter()[0] +
                     droplets[j].getarea() * droplets[j].getcenter()[0]) / \
                   (droplets[i].getarea() + droplets[j].getarea())
    new_droplet.y = (droplets[i].getarea() * droplets[i].getcenter()[1] +
                     droplets[j].getarea() * droplets[j].getcenter()[1]) / \
                   (droplets[i].getarea() + droplets[j].getarea())
    new_droplet.vx = (droplets[i].getarea() * droplets[i].getvel()[0] +
                     droplets[j].getarea() * droplets[j].getvel()[0]) / \
                    (droplets[i].getarea() + droplets[j].getarea())
    new_droplet.vy = (droplets[i].getarea() * droplets[i].getvel()[1] +
                     droplets[j].getarea() * droplets[j].getvel()[1]) / \
                    (droplets[i].getarea() + droplets[j].getarea())
    new_droplet.r = math.sqrt(new_droplet.vx ** 2 + new_droplet.vy ** 2)
    del droplets[i]
    droplets[j] = new_droplet
    return droplets


def update_droplets(droplets, collisions, dt):
    for i, j in collisions:
        droplets = merge_droplets(droplets, i, j)
    i = 0
    while i < len(droplets):
        droplets[i].move(dt)
        i += 1
