    n = int(input())
    MOD = 10**9 + 7

    def pow_mod(base, exp, mod):
        res = 1
        base %= mod
        while exp > 0:
            if exp % 2 == 1:
                res = res * base % mod
            base = base * base % mod
            exp //= 2
        return res
    def inv_mod(n, mod):
        return pow_mod(n, mod - 2, mod)
    def nCr(n, r, mod):
        if r > n:
            return 0
        if r == 0 or r == n:
            return 1
        res = 1
        for i in range(r):
            res = res * (n - i) % mod
            res = res * inv_mod(i + 1, mod) % mod
        return res
    ans = 0
    for i in range(n // 3 + 1):
        ans = (ans + nCr(n, 3 * i, MOD) * nCr(n - 3 * i, 3 * (n - 3 * i), MOD)
               * nCr(3 * i, 3, MOD) * nCr(3 * (n - 3 * i), 3, MOD)) % MOD
    print(ans)


