def solve():
    n = int(input())
    a = list(map(int, input().split()))

    MOD = 998244353

    def power(x, y, mod):
        res = 1
        x %= mod
        while y > 0:
            if y % 2 == 1:
                res = res * x % mod
            x = x * x % mod
            y //= 2
        return res

    def mod_inverse(x, mod):
        return power(x, mod - 2, mod)

    def binomial_coefficient(n, k, mod):
        if k < 0 or k > n:
            return 0
        if k == 0 or k == n:
            return 1
        res = 1
        for i in range(k):
            res = res * (n - i) % mod
            res = res * mod_inverse(i + 1, mod) % mod
        return res

    def calculate_expected_value(n, a, mod):
        dp = [([0] * 2) for _ in range(n + 1)]
        dp[0][0] = 1
        for i in range(1, n + 1):
            dp[i][0] = dp[i - 1][1] * a[i - 1] % mod
            dp[i][1] = (dp[i - 1][0] * a[i - 1] + dp[i - 1][1] * a[i - 1]) % mod
        return (dp[n][0] + dp[n][1]) % mod

    expected_value = calculate_expected_value(n, a, MOD)
    result = expected_value * binomial_coefficient(2 ** (n - 1), 1, MOD) % MOD
    print(result)


