        x, y = positions
        for u, v in edges:
            if x[u - 1] - x[v - 1] != 0:
                if y[u - 1] - y[v - 1] != 0:
                    return False
        return True

    def find_tree_center(edges):
        n = len(edges) + 1
        adj = [[] for _ in range(n)]
        for u, v in edges:
            adj[u - 1].append(v - 1)
            adj[v - 1].append(u - 1)

        def dfs(node, parent):
            children = 0
            for neighbor in adj[node]:
                if neighbor != parent:
                    children += dfs(neighbor, node)
            if children == 0:
                return 1
            elif children == n - 1:
                return n
            else:
                return children
        return dfs(0, -1)

    def find_center_positions(edges):
        n = len(edges) + 1
        center = find_tree_center(edges)
        x = [0] * n
        y = [0] * n

        def dfs(node, parent, pos_x, pos_y):
            x[node] = pos_x
            y[node] = pos_y
            for neighbor in adj[node]:
                if neighbor != parent:
                    dfs(neighbor, node, -pos_y, pos_x)
        dfs(center, -1, 0, 0)
        return x, y

    def find_any_position(edges):
        n = len(edges) + 1
        x = [0] * n
        y = [0] * n

        def dfs(node, parent):
            x[node] = 0
            y[node] = 0
            for neighbor in adj[node]:
                if neighbor != parent:
                    dfs(neighbor, node)
                    x[node] += x[neighbor]
                    y[node] += y[neighbor]
        dfs(0, -1)
        return x, y

