def solve():
    P, D, N = map(int, input().split())
    pumpkins = []
    for _ in range(P):
        pumpkins.append(tuple(map(int, input().split())))

    def is_valid(r, c):
        return 0 <= r < N and 0 <= c < N

    def get_neighbors(r, c):
        neighbors = []
        for dr in [-1, 0, 1]:
            for dc in [-1, 0, 1]:
                if dr == 0 and dc == 0:
                    continue
                nr = r + dr
                nc = c + dc
                if is_valid(nr, nc):
                    neighbors.append((nr, nc))
        return neighbors

    def simulate(days):
        days_passed = 0
        while days_passed < days:
            new_pumpkins = []
            for r, c in pumpkins:
                neighbors = get_neighbors(r, c)
                alive_neighbors = 0
                for nr, nc in neighbors:
                    if (nr, nc) in pumpkins:
                        alive_neighbors += 1
                if alive_neighbors == 0:
                    new_pumpkins.append((r, c))
                elif alive_neighbors == 1:
                    for nr, nc in neighbors:
                        if (nr, nc) not in pumpkins:
                            new_pumpkins.append((nr, nc))
            pumpkins = new_pumpkins
            days_passed += 1
        return pumpkins

    alive_pumpkins = simulate(D)
    for r, c in pumpkins:
        if (r, c) not in alive_pumpkins:
            print(D)
        else:
            print('ALIVE')


