    good_pairs = []
    for _ in range(m):
        i, j = map(int, input().split())
        good_pairs.append((i - 1, j - 1))

    def gcd(a, b):
        if b == 0:
            return a
        return gcd(b, a % b)

    def lcm(a, b):
        return a * b // gcd(a, b)

    def can_divide(i, j, v):
        return a[i] % v == 0 and a[j] % v == 0

    def get_common_divisors(i, j):
        common_divisors = []
        for d in range(2, min(a[i], a[j]) + 1):
            if a[i] % d == 0 and a[j] % d == 0:
                common_divisors.append(d)
        return common_divisors

    def get_possible_pairs(i, j, common_divisors):
        possible_pairs = []
        for d in common_divisors:
            if a[i] % d == 0 and a[j] % d == 0:
                possible_pairs.append((i, j, d))
        return possible_pairs

    def perform_operation(i, j, v):
        a[i] //= v
        a[j] //= v

    def solve_recursive(current_pairs):
        if not current_pairs:
            return 0

        max_operations = 0
        i, j = current_pairs[0]

        common_divisors = get_common_divisors(i, j)

        for v in common_divisors:
            if can_divide(i, j, v):
                perform_operation(i, j, v)
                new_pairs = current_pairs[1:]
                new_pairs.append((i, j, v))
                max_operations = max(max_operations, 1 + solve_recursive(new_pairs))
                perform_operation(i, j, v)

        return max_operations

    max_operations = 0
    for i in range(n):
        for j in range(i + 1, n):
            if (i + j) % 2 != 0:
                max_operations = max(max_operations, solve_recursive([(i, j)]))

    print(max_operations)


