    def check_validity():
        for i in range(n - 1):
            for j in range(i + 1, n):
                if distance(edges[i], edges[j]) < 1e-4:
                    return False
        return True

    def check_edge_distance(i, j):
        if i == j:
            return True
        if distance(edges[i], edges[j]) < 1e-6:
            return False
        return True

    def solve_tree(current_node, parent_node):
        for i in range(n):
            if i != current_node and i != parent_node:
                x[current_node] = (x[i] + x[parent_node]) / 2
                y[current_node] = (y[i] + y[parent_node]) / 2
                solve_tree(i, current_node)

    solve_tree(0, -1)

    if not check_validity():
        print('Invalid Input')
        return

    if not check_edge_distance(0, n - 1):
        print('Invalid Input')
        return

    def find_min_max(x_values, y_values):
        min_x = min(x_values)
        max_x = max(x_values)
        min_y = min(y_values)
        max_y = max(y_values)
        return min_x, max_x, min_y, max_y

