    h, w = map(int, input().split())
    grid = []
    for _ in range(h):
        grid.append(input())

    def find_frog(grid):
        for i in range(h):
            for j in range(w):
                if grid[i][j] == 'S':
                    return i, j
                elif grid[i][j] == 'T':
                    return i, j
        return -1, -1

    def is_reachable(start_row, start_col, end_row, end_col, grid):
        h, w = len(grid), len(grid[0])
        visited = [[False for _ in range(w)] for _ in range(h)]
        q = [(start_row, start_col)]
        visited[start_row][start_col] = True
        while q:
            row, col = q.pop(0)
            if row == end_row and col == end_col:
                return True
            for dr in [-1, 0, 1]:
                for dc in [-1, 0, 1]:
                    new_row = row + dr
                    new_col = col + dc
                    if 0 <= new_row < h and 0 <= new_col < w:
                        if not visited[new_row][new_col] and grid[new_row][
                                new_col] != '.':
                            visited[new_row][new_col] = True
                            q.append((new_row, new_col))
        return False

    frog_row, frog_col = find_frog(grid)
    leaves_to_remove = 0
    for i in range(h):
        for j in range(w):
            if grid[i][j] != 'S' and grid[i][j] != 'T':
                temp_grid = [row[:] for row in grid]
                temp_grid[i][j] = '.'
                if is_reachable(frog_row, frog_col, i, j, temp_grid):
                    leaves_to_remove += 1
                else:
                    temp_grid = [row[:] for row in grid]
                    temp_grid[i][j] = 'o'
                    if is_reachable(frog_row, frog_col, i, j, temp_grid):
                        leaves_to_remove += 1
    if leaves_to_remove == 0:
        print(-1)
    else:
        print(leaves_to_remove)


