    dp = {}

    def factorize(i):
        if i == n:
            return 0, ''
        if i in dp:
            return dp[i]
        min_weight = float('inf')
        best_factoring = ''
        for j in range(i, n):
            prefix = s[i:j + 1]
            suffix = s[j + 1:]
            if prefix * (n - j - 1) == suffix:
                weight = len(prefix) + factorize(j + 1)[0]
                if weight < min_weight:
                    min_weight = weight
                    best_factoring = prefix + ('(' + suffix + ')' if j < n - 2 else '')
        dp[i] = min_weight, best_factoring
        return dp[i]
    weight, _ = factorize(0)
    print(weight)


