def solve():
    n = int(input())
    packages = []
    for _ in range(n):
        packages.append(list(map(int, input().split())))

    def calculate_moves(path):
        x, y = 0, 0
        moves = 0
        for move in path:
            if move == 'R':
                x += 1
            else:
                y += 1
            moves += 1
        return moves, x, y

    def is_valid_path(path):
        moves, x, y = calculate_moves(path)
        return moves == n and x == 0 and y == 0

    def find_lexicographically_smallest_path():
        import itertools
        min_moves = float('inf')
        best_path = ''
        for perm in itertools.permutations(packages):
            path = ''
            for x, y in perm:
                if not path:
                    path += 'R' * x + 'U' * y
                else:
                    path += 'R' * (x - path.count('R')) + 'U' * (y - path.count(
                        'U'))
            if is_valid_path(path):
                moves, x, y = calculate_moves(path)
                if moves < min_moves:
                    min_moves = moves
                    best_path = path
                elif moves == min_moves and path < best_path:
                    best_path = path
        return best_path

    path = find_lexicographically_smallest_path()
    if not path:
        print('NO')
    else:
        print('YES')
        print(path)


