    def can_reach_target(target):
        fatigue = 0
        umbrellas_on_path = []
        for i in range(target + 1):
            umbrellas_on_current_path = []
            for umbrella in umbrellas_on_path:
                umbrellas_on_current_path.append(umbrella)
            for rain_start, rain_end in rain_segments:
                if rain_start <= i < rain_end:
                    umbrellas_on_current_path.append(umbrellas_on_current_path.pop(0))
            umbrellas_on_path = umbrellas_on_current_path
            if umbrellas_on_path:
                fatigue += sum(umbrella[1] for umbrella in umbrellas_on_path)
        return fatigue <= a
    low = 0
    high = a
    result = -1
    while low <= high:
        mid = (low + high) // 2
        if can_reach_target(mid):
            result = mid
            high = mid - 1
        else:
            low = mid + 1
    print(result)


